import classes from './Modal.module.css';
import Card from './'

function Modal(props){
    const click = props.clickButtons;
    return (
        <Card>
        <div className={classes.modal}>
            <p>
                Do you want to login?
            </p>
            <form>

            </form>
            <button className={`${classes.btn} ${classes.maketrans} ${classes.hoverNoclass}`} onClick={click}>No</button>
            <button className={`${classes.btn} ${classes.alt} ${classes.hoverYesclass}`} onClick = {click}>Yes</button>
        </div>
        </Card>
    );
}

export default Modal;
